import React, { useState } from "react";
import styles from "./Overview.module.css";
import {
  LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer,
  PieChart, Pie, Cell
} from "recharts";

const COLORS = ["#60a5fa", "#34d399", "#fbbf24", "#fb7185"];

const Overview = () => {
  const [transactions, setTransactions] = useState([
    { id: 1, type: "income", amount: 1200, category: "Salary", date: "2025-02-01" },
    { id: 2, type: "expense", amount: 40, category: "Food", date: "2025-02-02" },
    { id: 3, type: "expense", amount: 15, category: "Transport", date: "2025-02-03" },
    { id: 4, type: "expense", amount: 80, category: "Bills", date: "2025-02-04" },
  ]);

  const [typeFilter, setTypeFilter] = useState("all");

  // --- простой фильтр по типу ---
  const filtered = transactions.filter(t =>
    typeFilter === "all" ? true : t.type === typeFilter
  );

  // --- данные для линейного графика (очень упрощённо) ---
  let balance = 500;
  const lineData = transactions.map(t => {
    balance += t.type === "income" ? t.amount : -t.amount;
    return { date: t.date.slice(5), balance };
  });

  // --- данные для кругового графика ---
  const expenseSums = {};
  transactions.forEach(t => {
    if (t.type === "expense") {
      if (!expenseSums[t.category]) {
        expenseSums[t.category] = 0;
      }
      expenseSums[t.category] += t.amount;
    }
  });

  const pieData = Object.entries(expenseSums).map(([k, v]) => ({
    name: k,
    value: v,
  }));

  const deleteItem = (id) => {
    setTransactions(prev => prev.filter(t => t.id !== id));
  };

  const downloadJSON = () => {
    const data = JSON.stringify(transactions, null, 2);
    const blob = new Blob([data], { type: "application/json" });
    const a = document.createElement("a");
    a.href = URL.createObjectURL(blob);
    a.download = "transactions.json";
    a.click();
  };

  return (
    <div className="container">
      <h1>Overview</h1>

      <div className={styles.grid}>

        {/* Линейный график */}
        <div className={styles.card}>
          <h3>Balance Over Time</h3>
          <ResponsiveContainer width="100%" height={240}>
            <LineChart data={lineData}>
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="balance" stroke="#60a5fa" />
            </LineChart>
          </ResponsiveContainer>
        </div>

        {/* Круговой график */}
        <div className={styles.card}>
          <h3>Expenses Breakdown</h3>
          <ResponsiveContainer width="100%" height={240}>
            <PieChart>
              <Pie
                data={pieData}
                dataKey="value"
                nameKey="name"
                outerRadius={90}
                label
              >
                {pieData.map((e, i) => (
                  <Cell key={i} fill={COLORS[i % COLORS.length]} />
                ))}
              </Pie>
            </PieChart>
          </ResponsiveContainer>
        </div>

      </div>

      {/* Фильтры */}
      <div className={styles.filters}>
        <select value={typeFilter} onChange={e => setTypeFilter(e.target.value)}>
          <option value="all">Все</option>
          <option value="income">Доходы</option>
          <option value="expense">Расходы</option>
        </select>

        <button className={styles.btn} onClick={downloadJSON}>
          Скачать JSON
        </button>
      </div>

      {/* Список операций */}
      <div className={styles.card}>
        <h3>Транзакции</h3>
        {filtered.map(t => (
          <div key={t.id} className={styles.item}>
            <span>{t.date}</span>
            <span>{t.category}</span>
            <span className={t.type === "income" ? styles.income : styles.expense}>
              {t.type}
            </span>
            <span>{t.type === "income" ? "+" : "-"}{t.amount}$</span>
            <button className={styles.delete} onClick={() => deleteItem(t.id)}>×</button>
          </div>
        ))}
      </div>

    </div>
  );
};

export default Overview;
